import Countdown from "../components/common/Countdown";
import SignInButton from '../components/SignIn/SignInButton';
import SignInForm from '../components/SignIn/SignInForm';
import { useState } from 'react';


function SignInPage(props) {

    const [openForm, setOpenForm] = useState(false);

    return (
        <div className="signedOut" >
            <div className="container">
                <Countdown />
                <div className="message">
                    <p>Paul</p><p>&</p><p>Elyse</p>
                </div>
                {openForm ?
                    <SignInForm logIn={props.logIn} /> :
                    <p className="signInButton"
                        onClick={props.toggleForm}>
                        Join Us</p>}
                <p className="contact">Having trouble signining in? Contact Us at <p><i>paulandelysewedding@gmail.com</i></p></p>
                <p className="photocredit">Photo Credit: Brittany Fleming - Facebook: @bflemingphoto Instagram: @bflemingphotography</p>
            </div>
        </div >
    );
}

export default SignInPage;
